public MultiSearcherThread(
                           Searchable searchable,
                           Weight weight,
                           Filter filter,
                           int nDocs,
                           FieldDocSortedHitQueue hq,
                           Sort sort,
                           int i,
                           int[] starts,
                           String name) {
  super(name);
  this.searchable = searchable;
  this.weight = weight;
  this.filter = filter;
  this.nDocs = nDocs;
  this.hq = hq;
  this.i = i;
  this.starts = starts;
  this.sort = sort;
}

